import React from "react";
import '../Styles/Social.css'
import envelope from '../Assets/envelope.png'

const Social = () => {
    return(
        <div className="social-container">
            <div className="social-wrapper horizontal-wrapper">
                <img src={envelope}/>
            </div>
        </div>
    )
}

export default Social;
